import React from 'react';
import { useSelector } from 'react-redux';

const DownLoad = () => {
    const download = useSelector(state => state.file.fileDownload);
    return(
        <div style={{display: 'none'}}>
            <iframe src={download} />
        </div>)
}

export default DownLoad;
